import react from "react";

export const FrontSide = ({
  isFlipped,
  style,
  animationDuration,
  ...restprops
}) => (
  <FlippyCard
    {...props}
    style={{
      ...(style || {}),
    }}
    animationDuration={animationDuration}
    cardType='front'
  />
);

export const BackSide = ({ isFlipped, style, ...props }) => (
  <FlippyCard
    {...props}
    style={{
      ...(style || {}),
    }}
    cardType='back'
  />
);
